}];
export const Highlight = ({
  children,
  color
}) => <span style={{
  backgroundColor: color,
  borderRadius: '2px',
  color: '#fff',
  padding: '0.2rem'
}}>{children}</span>;

const layoutProps = {
  rightToc,
Highlight
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">



    <p>{`These REST API endpoints provide user account information and management.`}</p>
    <h2 {...{
      "id": "user"
    }}>{`User`}</h2>
    <h3 {...{
      "id": "get"
    }}><Highlight color="#25c2a0" mdxType="Highlight">{`GET`}</Highlight></h3>
    <p>{`This method retrieves basic account information.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`GET /rest/v1/users/<SAUCE_USERNAME>
`}</code></pre>
    <p><strong parentName="p">{`Examples`}</strong></p>
    <Tabs defaultValue="curl" values={[{
      label: 'cURL',
      value: 'curl'
    }, {
      label: 'Java',
      value: 'java'
    }, {
      label: 'C#',
      value: 'csharp'
    }, {
      label: 'node.js',
      value: 'node'
    }, {
      label: 'Python',
      value: 'python'
    }, {
      label: 'Ruby',
      value: 'ruby'
    }]} mdxType="Tabs">
      <TabItem value="curl" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{`curl -u <YOUR_SAUCE_USERNAME>:<YOUR_SAUCE_ACCESS_KEY> https://saucelabs.com/rest/v1/users/<YOUR_SAUCE_USERNAME>

`}</code></pre>
      </TabItem>
      <TabItem value="java" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-java"
          }}>{``}</code></pre>
      </TabItem>
      <TabItem value="csharp" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{``}</code></pre>
      </TabItem>
      <TabItem value="node" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-javascript"
          }}>{`let username = process.env.SAUCE_USERNAME;
let accessKey = process.env.SAUCE_ACCESS_KEY;
let url = 'https://saucelabs.com/rest/v1/users/' + username;

const axios = require("axios");
const getAccounts = async () => {
    try {
        response = await axios.get(url);
        console.log(response.data);
    }
    catch (error) {
        console.log(error);
    }
};
`}</code></pre>
      </TabItem>
      <TabItem value="python" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-python"
          }}>{``}</code></pre>
      </TabItem>
      <TabItem value="ruby" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-ruby"
          }}>{``}</code></pre>
      </TabItem>
    </Tabs>
    <p><strong parentName="p">{`Responses`}</strong></p>
    </MDXLayout>;
}

;
